package cn.finder.wae.api.sdk.request;import cn.finder.httpcommons.attri.JsonProperty;import cn.finder.httpcommons.request.DefaultRequest;import cn.finder.wae.api.sdk.response.UpdateUserPwdResponse;/**** wae-用户密码修改请求*/public class UpdateUserPwdRequest extends DefaultRequest<UpdateUserPwdResponse>{	@Override	public  String apiName()	{		return	"wae.userPwd.update";	}	@Override	public  void validate()	{	}	private String account;	public String getAccount() {		return account;	}	public void setAccount(String account) {		this.account = account;	}		private String oldPwd;	@JsonProperty(name="oldPwd")	public String getOldPwd() {		return oldPwd;	}	public void setOldPwd(String oldPwd) {		this.oldPwd = oldPwd;	}		private String newPwd;	@JsonProperty(name="newPwd")	public String getNewPwd() {		return newPwd;	}	public void setNewPwd(String newPwd) {		this.newPwd = newPwd;	}}